def cacl_SED(s,m,e):
    k = (m[2]-s[2])/(e[2]-s[2])
    px = ((1.0-k)*s[0]) + (k*e[0])
    py = ((1.0-k)*s[1]) + (k*e[1])
    sed = ((m[0]-px)*(m[0]-px))+((m[1]-py)*(m[1]-py))
    sqsed = np.sqrt(sed)
    return sqsed
