def intToBoolArray(integer,length):
    return [bool(integer & (1<<n)) for n in range(length)]

def count_set_bits(n):
    count = 0
    while n:
        n &= n - 1
        count += 1
    return count
def count_set_bitsString(n):
    count = 0
    if(n==0):
        return 0
    for i in range(len(n)):
        if(n[i]=="1"):
            count+=1
    return count
